import React from 'react';
import Nav from './Nav';
import './style/review.css';

const ReviewPage = () => {
  return (
    <div className="review-container">
      <Nav />
      <div className="review-data">
        <div className="review-image"></div>
        <label></label>
      </div>
    </div>
  );
}

export default ReviewPage;
